import React from "react";

const KeywordComponent = ({ data }) => {
  return (
    <div className="flex flex-col items-start gap-2 border rounded-2xl p-4">
      <span className="font-serif text-xl italic text-yellow-500">
        Keywords
      </span>

      {data && (
        <div className="flex items-start ">
          {data.keywords?.map((item, index) => {
            return (
              <ul key={index} className="flex items-center pr-5">
                <li className="border rounded-xl p-1 text-sm hover:bg-gray-400">
                  {item.name}
                </li>
              </ul>
            );
          })}
        </div>
      )}
    </div>
  );
};

export default KeywordComponent;
